// src/components/AddMaster.js
import React, { useState } from 'react';
import { useAuth } from '../context/AuthContext';
import Login from './Login';

const AddMaster = () => {
  const { isAuthenticated } = useAuth();
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [specialization, setSpecialization] = useState('');
  const [photo, setPhoto] = useState('');
  const [city, setCity] = useState('');
  const [service, setService] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      // Pakeiskite šią URL reikšmę savo backend API URL
      const response = await fetch('http://localhost:5000/api/masters', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          firstName,
          lastName,
          specialization,
          photo,
          city,
          service,
        }),
      });

      if (response.ok) {
        alert('Master added successfully!');
        // Išvalyti formą po sėkmingo įrašymo
        setFirstName('');
        setLastName('');
        setSpecialization('');
        setPhoto('');
        setCity('');
        setService('');
      } else {
        alert('Failed to add master.');
      }
    } catch (error) {
      console.error('Error:', error);
      alert('Error adding master.');
    }
  };

  return (
    <div>
      {isAuthenticated ? (
        <div>
          <h2>Add Master</h2>
          <form onSubmit={handleSubmit}>
            <input
              type="text"
              placeholder="First Name"
              value={firstName}
              onChange={(e) => setFirstName(e.target.value)}
              required
            />
            <input
              type="text"
              placeholder="Last Name"
              value={lastName}
              onChange={(e) => setLastName(e.target.value)}
              required
            />
            <input
              type="text"
              placeholder="Specialization"
              value={specialization}
              onChange={(e) => setSpecialization(e.target.value)}
              required
            />
            <input
              type="text"
              placeholder="Photo URL"
              value={photo}
              onChange={(e) => setPhoto(e.target.value)}
              required
            />
            <input
              type="text"
              placeholder="City"
              value={city}
              onChange={(e) => setCity(e.target.value)}
              required
            />
            <input
              type="text"
              placeholder="Service ID"
              value={service}
              onChange={(e) => setService(e.target.value)}
              required
            />
            <button type="submit">Add Master</button>
          </form>
        </div>
      ) : (
        <Login />
      )}
    </div>
  );
};

export default AddMaster;
